``#include <stdio.h>
#include <stdlib.h>
#include <math.h>
#include <string.h>
#define MAX 100000
int   is_prime [ MAX ];
long   long   phi [ MAX + 1 ];
void   calculate_phi ( int   max )
{
     int   i,   j ;
     double   sqrt_max ;
     for   ( i   =   0 ;   i   <   max ;   i ++ )
         is_prime [ i ]   =   1 ;
     is_prime [ 0 ]   =   0 ;
     is_prime [ 1 ]   =   0 ;
     for   ( i   =   0 ;   i   <   max + 1 ;   i ++ )
         phi [ i ]   =   0 ;
     sqrt_max   =   sqrt ( max );
     for   ( i   =   2 ;   i   <   sqrt_max ;   i ++ )
     {
         if   ( is_prime [ i ])
         {
             for   ( j   =   2 ;   j   <   max   /   i ;   j ++ )
                 is_prime [ i * j ]   =   0 ;
         }
     }
     for   ( i   =   2 ;   i   <=   max ;   i ++ )
     {
         if   ( is_prime [ i ])
             phi [ i ]   =   i   -   1 ;
         else
         {
             long   long   cur_phi   =   i ;
             for   ( j   =   2 ;   j   <   i ;   j ++ )
             {
                 if   ( is_prime [ j ]   &&   i   %   j   ==   0 )
                 {
                     while   ( i   %   j   ==   0 )
                         i   /=   j ;
                     cur_phi   *=   ( j   -   1 );
                     cur_phi   /=   j ;
                 }
             }
             phi [ i ]   =   cur_phi ;
         }
     }
}
int   is_permutation ( int   n1,   int   n2 )
{
     char   * count1,   * count2 ;
     int   i ;
     count1   =   ( char   * ) calloc ( 10,   sizeof ( char ));
     count2   =   ( char   * ) calloc ( 10,   sizeof ( char ));
     while   ( n1   >   0 )
     {
         count1 [ n1   %   10 ] ++ ;
         n1   /=   10 ;
     }
     while   ( n2   >   0 )
     {
         count2 [ n2   %   10 ] ++ ;
         n2   /=   10 ;
     }
     for   ( i   =   0 ;   i   <   10 ;   i ++ )
         if   ( count1 [ i ]  !=   count2 [ i ])
             return   0 ;
     free ( count1 );
     free ( count2 );
     return   1 ;
}
int   main ()
{
     int   i ;
     calculate_phi ( MAX );
     for   ( i   =   2 ;   i   <   MAX ;   i ++ )
         if   ( is_permutation ( i,   phi [ i ]))
             printf ( "%d %lld \n ",   i,   phi [ i ]);
     return   0 ;
}
``

